DROP TABLE IF EXISTS capitulo;
DROP TABLE IF EXISTS director;
DROP TABLE IF EXISTS serie_television;
DROP TABLE IF EXISTS productora;
DROP TABLE IF EXISTS idioma;
CREATE TABLE idioma(
	id_idioma CHAR,
    descripcion VARCHAR(100),
    PRIMARY KEY(id_idioma)
)ENGINE=INNODB;
CREATE TABLE productora(
	id_productora INT AUTO_INCREMENT,
    nombre_productora VARCHAR(250),
    logo LONGBLOB,
    R INT,
    G INT,
    B INT,
    activa TINYINT,
    PRIMARY KEY(id_productora)
)ENGINE=INNODB;
CREATE TABLE serie_television(
	id_serie_television INT AUTO_INCREMENT,
    fid_productora INT,
    fid_idioma_original CHAR,
    nombre_serie VARCHAR(300),
    temporada INT,
    fecha_emision DATE,
    costo_produccion DECIMAL(15,2),
    sipnosis VARCHAR(5000),
    portada LONGBLOB,
    activa TINYINT,
    PRIMARY KEY(id_serie_television),
    FOREIGN KEY(fid_idioma_original) REFERENCES idioma(id_idioma),
    FOREIGN KEY(fid_productora) REFERENCES productora(id_productora)
)ENGINE=INNODB;
CREATE TABLE director(
	id_director INT AUTO_INCREMENT,
    nombre_director VARCHAR(300),
    apellido_director VARCHAR(300),
    nacionalidad VARCHAR(400),
    activo TINYINT,
    PRIMARY KEY (id_director)
)ENGINE=INNODB;
CREATE TABLE capitulo(
	id_capitulo INT AUTO_INCREMENT,
    fid_serie_television INT,
    fid_director INT,
    numero_capitulo INT,
    nombre_capitulo VARCHAR(300),
    duracion TIME,
    activo TINYINT,
    PRIMARY KEY(id_capitulo),
    FOREIGN KEY(fid_serie_television) REFERENCES serie_television(id_serie_television),
    FOREIGN KEY(fid_director) REFERENCES director(id_director)
)ENGINE=INNODB;
