DROP PROCEDURE IF EXISTS LISTAR_PRODUCTORAS_TODAS;
DROP PROCEDURE IF EXISTS LISTAR_DIRECTOR_X_NOMBRE;
DROP PROCEDURE IF EXISTS INSERTAR_PRODUCTORA;
DROP PROCEDURE IF EXISTS INSERTAR_SERIE_TELEVISION;
DROP PROCEDURE IF EXISTS LISTAR_SERIES_TELEVISION_X_NOMBRE;
DROP PROCEDURE IF EXISTS INSERTAR_CAPITULO;
DROP PROCEDURE IF EXISTS LISTAR_CAPITULOS_X_ID_SERIE_TELEVISION;
DELIMITER $
CREATE PROCEDURE LISTAR_PRODUCTORAS_TODAS()
BEGIN
	SELECT id_productora, logo, nombre_productora, R, G, B FROM productora WHERE activa = 1; 
END$
CREATE PROCEDURE LISTAR_DIRECTOR_X_NOMBRE(
	IN _nombre_apellido VARCHAR(600)
)
BEGIN
	SELECT id_director, nombre_director, apellido_director, nacionalidad FROM director WHERE activo = 1 AND CONCAT(nombre_director,' ',apellido_director) LIKE CONCAT('%',_nombre_apellido,'%');
END$
CREATE PROCEDURE INSERTAR_PRODUCTORA(
	IN _logo LONGBLOB,
    IN _nombre VARCHAR(250)
)
BEGIN
	INSERT INTO productora(nombre_productora, logo) VALUES (_nombre,_logo);
END$
CREATE PROCEDURE INSERTAR_SERIE_TELEVISION(
	OUT _id_serie_television INT,
    IN _fid_productora INT,
    IN _fid_idioma_original CHAR,
    IN _nombre_serie VARCHAR(300),
    IN _temporada INT,
    IN _fecha_emision DATE,
    IN _costo_produccion DECIMAL(15,2),
    IN _sipnosis VARCHAR(5000),
    IN _portada LONGBLOB
)
BEGIN
	INSERT INTO serie_television(fid_productora,fid_idioma_original,nombre_serie,temporada,fecha_emision,costo_produccion,sipnosis,portada,activa) VALUES(_fid_productora,_fid_idioma_original,_nombre_serie,_temporada,_fecha_emision,_costo_produccion,_sipnosis,_portada,1);
    SET _id_serie_television = @@last_insert_id;
END$
DELIMITER $
CREATE PROCEDURE LISTAR_SERIES_TELEVISION_X_NOMBRE(
	IN _nombre_serie VARCHAR(300)
)
BEGIN
	SELECT s.id_serie_television, p.id_productora, p.nombre_productora, p.logo, p.R, p.G, p.B, i.id_idioma, i.descripcion as 'idioma_serie', s.nombre_serie, s.temporada, s.fecha_emision, s.costo_produccion, s.sipnosis, s.portada FROM serie_television s INNER JOIN productora p ON s.fid_productora = p.id_productora INNER JOIN idioma i ON s.fid_idioma_original = i.id_idioma WHERE s.activa = 1 AND s.nombre_serie LIKE CONCAT('%',_nombre_serie,'%');
END$
CREATE PROCEDURE INSERTAR_CAPITULO(
	OUT _id_capitulo INT,
    IN _fid_serie_television INT,
    IN _fid_director INT,
    IN _numero_capitulo INT,
	IN _nombre_capitulo VARCHAR(300),
    IN _duracion TIME
)
BEGIN
	INSERT INTO capitulo(fid_serie_television,fid_director,numero_capitulo,nombre_capitulo,duracion,activo) VALUES(_fid_serie_television,_fid_director,_numero_capitulo,_nombre_capitulo,_duracion,1);
    SET _id_capitulo = @@last_insert_id;
END$
CREATE PROCEDURE LISTAR_CAPITULOS_X_ID_SERIE_TELEVISION(
	IN _id_serie_television INT
)
BEGIN
	SELECT c.id_capitulo, c.numero_capitulo, c.nombre_capitulo, c.duracion, d.id_director, d.nombre_director, d.apellido_director, d.nacionalidad FROM capitulo c INNER JOIN director d ON c.fid_director = d.id_director where c.activo = 1 and c.fid_serie_television = _id_serie_television;
END$